import * as WebBrowser from 'expo-web-browser';
import React from 'react';
import { StyleSheet, TouchableOpacity } from 'react-native';

import Colors from '../constants/Colors';
import { MonoText } from './StyledText';
import { Text, View } from './Themed';

export default function Components_Chat({ path }: { path: string }) {
  return (
    <View>
      <Text style={styles.title}>Login</Text>
      <Text>This is the chat</Text>

      <View style={styles.card_message}>
        <Text style={styles.username}>Name of user</Text>
        <Text style={styles.message_text}>Message of the user</Text>
      </View>
      </View>
  );
}

function handleHelpPress() {
  WebBrowser.openBrowserAsync(
    'https://docs.expo.io/get-started/create-a-new-app/#opening-the-app-on-your-phonetablet'
  );
}

const styles = StyleSheet.create({
  getStartedContainer: {
    alignItems: 'center',
    marginHorizontal: 50,
  },
  homeScreenFilename: {
    marginVertical: 7,
  },
  codeHighlightContainer: {
    borderRadius: 3,
    paddingHorizontal: 4,
  },
  getStartedText: {
    fontSize: 17,
    lineHeight: 24,
    textAlign: 'center',
  },
  helpContainer: {
    marginTop: 15,
    marginHorizontal: 20,
    alignItems: 'center',
  },
  helpLink: {
    paddingVertical: 15,
  },
  helpLinkText: {
    textAlign: 'center',
  },
  card_message: {
    backgroundColor: '#ff9900',
    borderRadius: 20,
  },
  message_text: {
    fontSize: 20,
    fontWeight: 'bold'
  },
  username: {
    fontSize: 50,
    fontWeight: 'bold'
  }
});
